function checkPass(){var s=document.getElementById("user_password").value,e=document.getElementById("user_password_verify").value;return s==e?($("#confirmMessage").html("Passwords Match!"),$("#confirmMessageDiv").removeClass("alert alert-warning").addClass("alert alert-success").show(),!0):($("#confirmMessage").html("Passwords Do Not Match!"),$("#confirmMessageDiv").removeClass("alert alert-success").addClass("alert alert-warning").show(),!1)}function checkSubmit(){checkPass()?document.getElementById("installForm").submit():$("#passwordsAlert").show()}